// ARM SysTick period interrupts
// Input: interrupts every 12.5ns*period
//        priority is 0 (highest) to 3 (lowest)
void Sound_Init(uint32_t period, uint32_t priority){
  SysTick->CTRL = 0;
  SysTick->LOAD = period-1;
  SysTick->VAL = 0;
  SCB->SHP[1] = (SCB->SHP[1]&(~0xC0000000))|(priority<<30); //sets priority bits (31 & 30)
  SysTick->CTRL = 7;
  __enable_irq(); //turns on global interrupts
  Index = 0;
}

void Sound_Stop(void){
  SysTick->LOAD = 0; //Stops timer
}


void Sound_Start(uint32_t period){
  SysTick->LOAD = period-1;
  SysTick->VAL = 0; //restarts timer
}

// Interrupt service routine
// Executed every 12.5ns*(period)
void SysTick_Handler(void){
    if(last == 1 || last == 2 || last == 4 || last == 8){
      DAC5_Out(SinTable[Index]); // output one value to DAC
      Index = (Index + 1) % 0x20;
    } 
    if(last == 16){
      DAC5_Out(ShootTable[Index]);
      Index = (Index + 1) % 0xFF0;
    }
    if(last == 32){
      DAC5_Out(ExplosionTable[Index]);
      Index = (Index + 1) % 0x221B;
    }
    if(last == 64){
      DAC5_Out(UFOTable[Index]);
      Index = (Index + 1) % 0x64CD;
    }
    if(last == 128){
      DAC5_Out(IceballTable[Index]);
      Index = (Index + 1) % 0x425B;
    }
}





